00014     public static JsonSyntaxUnit ParseText(
00015         ResourceUri resourceUri,
00016         string content)
00017     {
00018         // Items to return wrapped in a JsonSyntaxUnit
00019         var jsonDocumentChildren = new List<IJsonSyntax>();
00020         var textEditorJsonDiagnosticBag = new DiagnosticBag();
00021 
00022         // Step through the string 'character by character'
00023         var stringWalker = new StringWalker(resourceUri, content);
00024 
00025         // Order matters with the methods of pattern, 'Consume{Something}'
00026         // Example: 'ConsumeComment'
00027         while (!stringWalker.IsEof)
00028         {
00029             if (stringWalker.CurrentCharacter == JsonFacts.OBJECT_START)
00030             {
00031                 var jsonObjectSyntax = ConsumeObject(
00032                     stringWalker,
00033                     textEditorJsonDiagnosticBag);
00034 
00035                 jsonDocumentChildren.Add(jsonObjectSyntax);
00036             }
00037             else if (stringWalker.CurrentCharacter == JsonFacts.ARRAY_START)
00038             {
00039                 var jsonObjectSyntax = ConsumeArray(
00040                     stringWalker,
00041                     textEditorJsonDiagnosticBag);
00042 
00043                 jsonDocumentChildren.Add(jsonObjectSyntax);
00044             }
00045 
00046             _ = stringWalker.ReadCharacter();
00047         }
00048 
00049         var jsonDocumentSyntax = new JsonDocumentSyntax(
00050             new TextEditorTextSpan(
00051                 0,
00052                 stringWalker.PositionIndex,
00053                 (byte)JsonDecorationKind.None,
00054                 stringWalker.ResourceUri,
00055                 stringWalker.SourceText),
00056             jsonDocumentChildren.ToImmutableArray());
00057 
00058         var jsonSyntaxUnit = new JsonSyntaxUnit(
00059             jsonDocumentSyntax,
00060             textEditorJsonDiagnosticBag);
00061 
00062         return jsonSyntaxUnit;
00063     }
