00072     private static JsonObjectSyntax ConsumeObject(
00073         StringWalker stringWalker,
00074         DiagnosticBag diagnosticBag)
00075     {
00076         var startingPositionIndex = stringWalker.PositionIndex;
00077 
00078         var jsonPropertySyntaxes = new List<JsonPropertySyntax>();
00079 
00080         // While loop state
00081         JsonPropertyKeySyntax? pendingJsonPropertyKeySyntax = null;
00082         var foundPropertyDelimiterBetweenKeyAndValue = false;
00083         JsonPropertyValueSyntax? pendingJsonPropertyValueSyntax = null;
00084 
00085         while (!stringWalker.IsEof)
00086         {
00087             _ = stringWalker.ReadCharacter();
00088 
00089             // Skip whitespace
00090             while (!stringWalker.IsEof)
00091             {
00092                 if (WhitespaceFacts.ALL_LIST.Contains(stringWalker.CurrentCharacter))
00093                     _ = stringWalker.ReadCharacter();
00094                 else
00095                     break;
00096             }
00097 
00098             if (JsonFacts.OBJECT_END == stringWalker.CurrentCharacter)
00099                 break;
00100 
00101             if (JsonFacts.PROPERTY_ENTRY_DELIMITER == stringWalker.CurrentCharacter)
00102                 continue;
00103 
00104             if (pendingJsonPropertyKeySyntax is null)
00105             {
00106                 pendingJsonPropertyKeySyntax = ConsumePropertyKey(
00107                     stringWalker,
00108                     diagnosticBag);
00109             }
00110             else if (!foundPropertyDelimiterBetweenKeyAndValue)
00111             {
00112                 while (!stringWalker.IsEof)
00113                 {
00114                     if (JsonFacts.PROPERTY_DELIMITER_BETWEEN_KEY_AND_VALUE != stringWalker.CurrentCharacter)
00115                         _ = stringWalker.ReadCharacter();
00116                     else
00117                         break;
00118                 }
00119 
00120                 // If Eof ended the loop to find the delimiter
00121                 // the outer while loop will finish as well so
00122                 // no EOF if is needed just set found to true
00123                 foundPropertyDelimiterBetweenKeyAndValue = true;
00124             }
00125             else
00126             {
00127                 pendingJsonPropertyValueSyntax = ConsumePropertyValue(
00128                     stringWalker,
00129                     diagnosticBag);
00130 
00131                 var jsonPropertySyntax = new JsonPropertySyntax(
00132                     new TextEditorTextSpan(
00133                         startingPositionIndex,
00134                         stringWalker.PositionIndex,
00135                         (byte)JsonDecorationKind.PropertyKey,
00136                         stringWalker.ResourceUri,
00137                         stringWalker.SourceText),
00138                     pendingJsonPropertyKeySyntax,
00139                     pendingJsonPropertyValueSyntax);
00140 
00141                 // Reset while loop state
00142                 pendingJsonPropertyKeySyntax = null;
00143                 foundPropertyDelimiterBetweenKeyAndValue = false;
00144                 pendingJsonPropertyValueSyntax = null;
00145 
00146                 jsonPropertySyntaxes.Add(jsonPropertySyntax);
00147             }
00148         }
00149 
00150         if (pendingJsonPropertyKeySyntax is not null)
00151         {
00152             // This is to mean the property value is
00153             // invalid in some regard
00154             //
00155             // Still however, render the syntax highlighting
00156             // for the valid property key.
00157 
00158             var jsonPropertySyntax = new JsonPropertySyntax(
00159                 new TextEditorTextSpan(
00160                     startingPositionIndex,
00161                     stringWalker.PositionIndex,
00162                     (byte)JsonDecorationKind.PropertyKey,
00163                     stringWalker.ResourceUri,
00164                     stringWalker.SourceText),
00165                 pendingJsonPropertyKeySyntax,
00166                 JsonPropertyValueSyntax.GetInvalidJsonPropertyValueSyntax());
00167 
00168             jsonPropertySyntaxes.Add(jsonPropertySyntax);
00169         }
00170 
00171         if (stringWalker.IsEof)
00172         {
00173             diagnosticBag.ReportEndOfFileUnexpected(
00174                 new TextEditorTextSpan(
00175                     stringWalker.PositionIndex,
00176                     stringWalker.PositionIndex + 1,
00177                     (byte)JsonDecorationKind.Error,
00178                     stringWalker.ResourceUri,
00179                     stringWalker.SourceText));
00180         }
00181 
00182         var jsonObjectSyntax = new JsonObjectSyntax(
00183             new TextEditorTextSpan(
00184                 startingPositionIndex,
00185                 stringWalker.PositionIndex,
00186                 (byte)JsonDecorationKind.None,
00187                 stringWalker.ResourceUri,
00188                 stringWalker.SourceText),
00189             jsonPropertySyntaxes.ToImmutableArray());
00190 
00191         return jsonObjectSyntax;
00192     }
