00201     private static JsonPropertyKeySyntax ConsumePropertyKey(
00202         StringWalker stringWalker,
00203         DiagnosticBag diagnosticBag)
00204     {
00205         // +1 to not include the quote that begins the key's text
00206         var startingPositionIndex = stringWalker.PositionIndex + 1;
00207 
00208         while (!stringWalker.IsEof)
00209         {
00210             _ = stringWalker.ReadCharacter();
00211 
00212             if (JsonFacts.PROPERTY_KEY_END == stringWalker.CurrentCharacter)
00213                 break;
00214         }
00215 
00216         if (stringWalker.IsEof)
00217         {
00218             diagnosticBag.ReportEndOfFileUnexpected(
00219                 new TextEditorTextSpan(
00220                     stringWalker.PositionIndex,
00221                     stringWalker.PositionIndex + 1,
00222                     (byte)JsonDecorationKind.Error,
00223                     stringWalker.ResourceUri,
00224                     stringWalker.SourceText));
00225         }
00226 
00227         var jsonPropertyKey = new JsonPropertyKeySyntax(
00228             new TextEditorTextSpan(
00229                 startingPositionIndex,
00230                 stringWalker.PositionIndex,
00231                 (byte)JsonDecorationKind.PropertyKey,
00232                 stringWalker.ResourceUri,
00233                 stringWalker.SourceText),
00234             ImmutableArray<IJsonSyntax>.Empty);
00235 
00236         return jsonPropertyKey;
00237     }
