00283 
00284         if (stringWalker.IsEof)
00285         {
00286             diagnosticBag.ReportEndOfFileUnexpected(
00287                 new TextEditorTextSpan(
00288                     stringWalker.PositionIndex,
00289                     stringWalker.PositionIndex + 1,
00290                     (byte)JsonDecorationKind.Error,
00291                     stringWalker.ResourceUri,
00292                     stringWalker.SourceText));
00293         }
00294 
00295         var jsonPropertyValue = new JsonPropertyValueSyntax(
00296             new TextEditorTextSpan(
00297                 startingPositionIndex,
00298                 stringWalker.PositionIndex,
00299                 (byte)JsonDecorationKind.None,
00300                 stringWalker.ResourceUri,
