00406     private static IJsonSyntax ConsumeAmbiguousValue(
00407         StringWalker stringWalker,
00408         DiagnosticBag diagnosticBag)
00409     {
00410         var startingPositionIndex = stringWalker.PositionIndex;
00411 
00412         var firstWordTuple = stringWalker.ReadWordTuple(new[]
00413         {
00414             ','
00415         }.ToImmutableArray());
00416 
00417         if (JsonFacts.NULL_STRING_VALUE == firstWordTuple.value)
00418         {
00419             return new JsonNullSyntax(
00420                 new TextEditorTextSpan(
00421                     startingPositionIndex,
00422                     stringWalker.PositionIndex,
00423                     (byte)JsonDecorationKind.Keyword,
00424                     stringWalker.ResourceUri,
00425                     stringWalker.SourceText));
00426         }
00427         else if (JsonFacts.BOOLEAN_ALL_STRING_VALUES.Contains(firstWordTuple.value))
00428         {
00429             return new JsonBooleanSyntax(new TextEditorTextSpan(
00430                 startingPositionIndex,
00431                 stringWalker.PositionIndex,
00432                 (byte)JsonDecorationKind.Keyword,
00433                 stringWalker.ResourceUri,
00434                 stringWalker.SourceText));
00435         }
00436         else
00437         {
00438             if (firstWordTuple.value.Contains(JsonFacts.NUMBER_DECIMAL_PLACE_SEPARATOR))
00439             {
00440                 return new JsonNumberSyntax(new TextEditorTextSpan(
00441                     startingPositionIndex,
00442                     stringWalker.PositionIndex,
00443                     (byte)JsonDecorationKind.Number,
00444                     stringWalker.ResourceUri,
00445                     stringWalker.SourceText));
00446             }
00447 
00448             return new JsonIntegerSyntax(new TextEditorTextSpan(
00449                 startingPositionIndex,
00450                 stringWalker.PositionIndex,
00451                 (byte)JsonDecorationKind.Integer,
00452                 stringWalker.ResourceUri,
00453                 stringWalker.SourceText));
00454         }
